pragma solidity ^0.4.24;

contract Funding {

    address public manager;
    string public projectName;
    uint256 public targetMoney;
    uint256 public supportMoney;
    uint256 public endTime;
    //投资人的集合
    address[] public supporters;
    // 为了方便判断是否有投资人
    mapping(address=>bool) supportersMap;
    //    请求集合
    Request[] requests;


    constructor (string _projectName, uint256 _targetMoney, uint256 _supportMoney, uint256 _duration) public {
        manager = msg.sender;
        projectName = _projectName;
        targetMoney = _targetMoney;
        supportMoney = _supportMoney;
        endTime = block.timestamp + _duration;
    }

    //    支持的方法
    function support() payable public {
        require(msg.value == supportMoney, "投资金额错误");
        supporters.push(msg.sender);
        supportersMap[msg.sender]=true;
    }

    //    退款
    function refund() public {
        for (uint256 i = 0; i < supporters.length; i++) {
            supporters[i].transfer(supportMoney);
        }
        delete (supporters);
    }

    function getBalance() public view returns (uint256){
        return address(this).balance;
    }

    function getSupporters() public view returns (address[]){
        return supporters;
    }

    //        当前状态。0：投票中，1：已批准，2：已完成，3：拒绝
    enum RequestStatus {
        Voting, Approved, Completed, Reject
    }

    struct Request {
        string purpose;
        uint256 cost;
        address shopAddress;
        uint256 voteCount;
        mapping(address => bool) voteMap;

        RequestStatus status;
    }

    //    新增请求
    function createRequest(string _purpose, uint256 _cost, address _shopAddress) public {
        require(msg.sender == manager, "只有项目发起人可以发起支付请求");
        Request memory request = Request({
            purpose:_purpose,
            cost:_cost,
            shopAddress:_shopAddress,
            voteCount:0,
            status:RequestStatus.Voting
        });
        
        requests.push(request);
    }

    // 批转请求
    function approveRequest(uint256 _requestId){
        // 先从集合中拿到请求
        Request request= requests[_requestId];
        // 查看是否有投票权
        require(supportersMap[msg.sender],"只有投资人有");


    }


}

